drop sequence if exists hibernate_sequence;
drop table if exists logs cascade;
drop table if exists user_roles cascade;
drop table if exists roles cascade;
drop table if exists cash_registers cascade;
drop table if exists office_inventories cascade;
drop table if exists office_profiles cascade;
drop table if exists offices cascade;
drop table if exists products cascade;
drop table if exists businesses cascade;
drop table if exists discounts cascade;
drop table if exists employee_profiles cascade;
drop table if exists contact_information cascade;
drop table if exists questions cascade;
drop table if exists answers cascade;
drop table if exists users cascade;
drop table if exists question_authors cascade;
drop table if exists receipt_statuses cascade;

create sequence if not exists hibernate_sequence MINVALUE 50;

create table if not exists logs
(
    id         bigint    not null
        constraint logs_pkey
            primary key,
    created_at timestamp not null,
    updated_at timestamp not null,
    message    varchar(255)
);

create table if not exists roles
(
    id   bigint not null
        constraint roles_pkey
            primary key,
    name varchar(60)
        constraint uk_nb4h0p6txrmfc0xbrd1kglp9t
            unique
);

create table if not exists users
(
    id         bigint    not null
        constraint users_pkey
            primary key,
    created_at timestamp not null,
    updated_at timestamp not null,
    email      varchar(255)
        constraint uk6dotkott2kjsp8vw4d0m25fb7
            unique,
    password   varchar(255),
    username   varchar(255)
        constraint ukr43af9ap4edm43mmtq01oddj6
            unique
);

create table if not exists user_roles
(
    user_id bigint not null
        constraint fkhfh9dx7w3ubf1co1vdev94g3f
            references users,
    role_id bigint not null
        constraint fkh8ciramu9cc9q3qcqiv4ue8a6
            references roles,
    constraint user_roles_pkey
        primary key (user_id, role_id)
);


create table if not exists businesses
(
    id                 bigint    not null
        constraint businesses_pkey
            primary key,
    created_at         timestamp not null,
    updated_at         timestamp not null,
    name               varchar(255),
    restaurant_feature boolean   not null,
    merchant_id        bigint
);


create table if not exists contact_information
(
    id           bigint not null
        constraint contact_information_pkey
            primary key,
    address      varchar(255),
    city         varchar(255),
    country      varchar(255),
    email        varchar(255),
    phone_number varchar(255)
);


create table if not exists employee_profiles
(
    id              bigint    not null
        constraint employee_profiles_pkey
            primary key,
    created_at      timestamp not null,
    updated_at      timestamp not null,
    name            varchar(255),
    surname         varchar(255),
    date_of_birth   date,
    jmbg            varchar(255),
    account_id      bigint
        constraint fkh1dkqpo9xxa1lwlfkg1qv0nlu
            references users,
    business_id     bigint
        constraint fka8e6q6hirh4n4x2rm7y2tcncs
            references businesses,
    contact_info_id bigint null
        constraint fk7jrp663by977139cmjyt9gqn1
            references contact_information
);

alter table businesses
    add constraint fknqndphlt4tpyy6n52k9ddxp7t
        foreign key (merchant_id) references employee_profiles;


create table if not exists offices
(
    id              bigint    not null
        constraint offices_pkey
            primary key,
    created_at      timestamp not null,
    updated_at      timestamp not null,
    work_day_start  time,
    work_day_end    time,
    business_id     bigint    not null
        constraint fkbp1p3tusy5bhen3hkcn8cb9m6
            references businesses,
    contact_info_id bigint
        constraint fkmrb8ysjycec6ielfnm521fhwy
            references contact_information,
    manager_id      bigint
        constraint fk9xfh83raua1ehm5wvdnho2qrg
            references employee_profiles
);


create table if not exists office_profiles
(
    id          bigint    not null
        constraint office_profiles_pkey
            primary key,
    created_at  timestamp not null,
    updated_at  timestamp not null,
    employee_id bigint
        constraint fklq2nvgsjnd3q4a7fcw3e570is
            references employee_profiles,
    office_id   bigint
        constraint fkhabcxlwsc5s3203u6vpx7l3pi
            references offices
);

create table receipt_statuses
(
    id          bigint    not null
        constraint receipt_statuses_pkey
            primary key,
    created_at  timestamp not null,
    updated_at  timestamp not null,
    status_name varchar(60)
        constraint uk_kb9lhqfcds25c61t5aog9f6as
            unique
);

create table discounts
(
    id         bigint    not null
        constraint discounts_pkey
            primary key,
    created_at timestamp not null,
    updated_at timestamp not null,
    percentage integer   not null
);

create table products
(
    id          bigint    not null
        constraint products_pkey
            primary key,
    created_at  timestamp not null,
    updated_at  timestamp not null,
    barcode     varchar(255),
    image       bytea,
    name        varchar(255),
    price       numeric(19, 2),
    unit        varchar(255),
    business_id bigint    not null
        constraint fki65q12p725kxcn1jcosg2x9y4
            references businesses,
    discount_id bigint
        constraint fk5cyj7v7fvm60i2ubciqfo2wxm
            references discounts
);

create table office_inventories
(
    id         bigint           not null
        constraint office_inventories_pkey
            primary key,
    created_at timestamp        not null,
    updated_at timestamp        not null,
    quantity   double precision not null,
    office_id  bigint
        constraint fknvoqbm0j3tbs8088002xkd695
            references offices
            on delete cascade,
    product_id bigint
        constraint fkiwpg2ywep5wiivchy637fqvm6
            references products
            on delete cascade
);

create table warehouses
(
    id          bigint           not null
        constraint warehouses_pkey
            primary key,
    created_at  timestamp        not null,
    updated_at  timestamp        not null,
    quantity    double precision not null,
    business_id bigint
        constraint fk5prejmn6a7j48qwxs9hu3hpmq
            references businesses,
    product_id  bigint
        constraint fki6vrqvs8nf0mbp3nrbmkedqfs
            references products
            on delete cascade
);

create table cash_registers
(
    id         bigint    not null
        constraint cash_registers_pkey
            primary key,
    created_at timestamp not null,
    updated_at timestamp not null,
    name       varchar(255),
    office_id  bigint    not null
        constraint fkkeo6o0cv1fe5u26diiu2nhxsn
            references offices
);

